import React from 'react';
import { Numeral } from 'numeral';

const MovieItem = ({item}) => {
    const {rank,movieNm, salesAmt,audiCnt, rankIntem} = item
    return (
        <tr>
            <td>{rank}</td>
            <td>{movieNm}</td>
            <td>{salesAmt}</td>
            <td>{Numeral(audiCnt).format(0,0)}</td>
            <td>{Numeral(rankIntem).format(0,0)}</td>
        </tr>
    );
};

export default MovieItem;
